import React from 'react'

const BotSpecs = ({onClose, bot}) => {

  // Function that handles the onclose button click
   const handleClickClose = () =>{
    onClose();
   }
  return (
    <div>
     <h2>{bot.name}</h2>
      <img src={bot.image} alt={bot.name} />
      <p>Catchphrase: {bot.phrase}</p>
      <p>Health: {bot.health}</p>
      <p>Damage: {bot.damage}</p>
      <p>Armor: {bot.armor}</p>

      {/* Create a go button with the function handleclose */}
      <button onClick={handleClickClose}>Go Back</button>
    </div>
  )
}

export default BotSpecs
